import React from 'react';

function Add(x,y) {
  let z = x+y;
  return z;
}

function Sub(x,y) {
  let z = x-y;
  return z;
}

function Mul(x,y) {
  let z = x*y;
  return z;
}

function Div(x,y) {
  let z = x/y;
  return z;
}
export {Add , Sub, Mul };
